DROP TABLE IF EXISTS "players";
DROP SEQUENCE IF EXISTS players_id_seq;
CREATE SEQUENCE players_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1;

CREATE TABLE "public"."players" (
    "id" bigint DEFAULT nextval('players_id_seq') NOT NULL,
    "name" character varying(191) NOT NULL,
    "aoe2net_id" integer,
    "elo" double precision DEFAULT '1' NOT NULL,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    "status" character varying(255) DEFAULT '1' NOT NULL,
    "avatar_url" text,
    "alias" character varying(191),
    "elo_unranked" double precision DEFAULT '1000',
    "elo_1v1" double precision DEFAULT '0',
    "elo_team" double precision DEFAULT '0',
    "meta_data" json,
    "drops" double precision DEFAULT '0' NOT NULL,
    "streak" double precision DEFAULT '0' NOT NULL,
    "last_win_count" double precision DEFAULT '0' NOT NULL,
    "last_lose_count" double precision DEFAULT '0' NOT NULL,
    "final_elo" double precision DEFAULT '0' NOT NULL,
    "crown" character varying(191),
    CONSTRAINT "players_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

COMMENT ON COLUMN "public"."players"."drops" IS 'Number of drops';

COMMENT ON COLUMN "public"."players"."streak" IS 'Current win/loss streak';


